INSERT INTO `posts` VALUES (1,1953.8,'2025-05-14 09:39:01.357108','user48@gmail.com',_binary '\0','Văn phòng cho thuê chuyên nghiệp, diện tích 1953.8 m2, không gian mở hiện đại. Địa chỉ: Số 945 Đường B7, Xã Xuân Hưng, Huyện Xuân Lộc, Tỉnh Đồng Nai.\n\n**Thông tin bổ sung**:\n- Vị trí đắc địa: Nằm trong khu vực phát triển sôi động, xung quanh có đầy đủ tiện ích như trường học quốc tế, bệnh viện đa khoa, siêu thị lớn, công viên xanh mát và các trung tâm thương mại hiện đại.\n- Giao thông thuận tiện: Gần các trục đường chính và tuyến giao thông huyết mạch, dễ dàng di chuyển đến trung tâm thành phố hoặc các khu vực lân cận trong thời gian ngắn.\n- Tiện ích đa dạng: Cư dân được hưởng các tiện ích cao cấp như hồ bơi, phòng gym, khu vui chơi trẻ em, không gian BBQ ngoài trời, và hệ thống an ninh 24/7 đảm bảo sự an toàn tuyệt đối.\n- Hỗ trợ toàn diện: Đội ngũ tư vấn chuyên nghiệp sẵn sàng hỗ trợ từ A-Z, bao gồm xem nhà miễn phí, tư vấn pháp lý nhanh chóng, và đàm phán giá tốt nhất để bạn có được giao dịch hoàn hảo.\n- Cam kết chất lượng: Chúng tôi cung cấp thông tin minh bạch, chính xác, đảm bảo mọi chi tiết về bất động sản đều được kiểm tra kỹ lưỡng trước khi giới thiệu đến bạn.\n- Cơ hội không thể bỏ lỡ: Hãy liên hệ ngay hôm nay để được tư vấn chi tiết, đặt lịch xem nhà thực tế, và nhận ưu đãi đặc biệt dành riêng cho khách hàng sớm nhất!','Số 945 Đường B7','2025-07-24 05:14:27.142589',10.853722850013943,107.49083436248203,_binary '',39056439,'APPROVED','Cho Thuê Văn Phòng 1953.8 m2 Hiện Đại Tại Trung Tâm','RENT',NULL,NULL,600,8,741,75,49,2,26446),(2,306.5,'2025-05-14 09:39:01.373257','user47@gmail.com',_binary '\0','Phòng trọ cho thuê sạch sẽ, diện tích 306.5 m2, thiết kế gọn gàng. Địa chỉ: Số 914 Đường B1, Xã Nguyễn Việt Khái, Huyện Phú Tân, Tỉnh Cà Mau.\n\n**Thông tin bổ sung**:\n- Vị trí đắc địa: Nằm trong khu vực phát triển sôi động, xung quanh có đầy đủ tiện ích như trường học quốc tế, bệnh viện đa khoa, siêu thị lớn, công viên xanh mát và các trung tâm thương mại h